import { ref, computed, onMounted } from 'vue'

export default {
  setup() {
    // 
    const count = ref(0)
    
    // 
    const doubleCount = computed(() => count.value * 2)
    
    // 
    const increment = () => {
      count.value++
    }
    
    // 
    onMounted(() => {
      console.log('')
    })
    
    return {
      count,
      doubleCount,
      increment
    }
  }
}
